import Foundation
import SwiftData

@Model
final class Station: Equatable, Identifiable {
    @Attribute(.unique) var stationId: String
    var name: String
    var lat: Float
    var long: Float
    var routes: [Route]
    @Relationship(deleteRule: .cascade, inverse: \TrainArrival.station) var arrivals: [TrainArrival]?
    var isFavorite: Bool
    var isSelected: Bool
    
    init(stationId: String, name: String, lat: Float, long: Float, routes: [Route]) {
        self.stationId = stationId
        self.name = name
        self.lat = lat
        self.long = long
        self.routes = routes
        self.arrivals = []
        self.isFavorite = false
        self.isSelected = false
    }
    
    static var DEFAULT = Station(stationId: "", name: "", lat: 0, long: 0, routes: [])
    
    static func ==(lhs: Station, rhs: Station) -> Bool {
        return lhs.stationId == rhs.stationId
    }
    
    static func get(id: String) -> Station {
        return allStations[id] ?? Station.DEFAULT
    }
    
